import React from 'react'
import test from '../Images/bg1.jpeg'
export const Card = ({ getAnime }) => {
    console.log(getAnime);
    return (
        <div>
            <div className='grid grid-cols-1'>

                {getAnime.map((res, key) => {
                    return (
                        <div className='text-white'>
                            <img src={res.images.jpg.image_url} alt="" />
                            <div>
                                <p>Title: {res.title}</p>
                                {res.studios((res, key) => {
                                    return (
                                        <p>{res.name}</p>                                        
                                    )
                                })}
                                <p>Score : {res.score}</p>
                            </div>
                        </div>
                    )
                })}

            </div>
        </div>
    )
}
